import {TextField } from "@material-ui/core";
// import { Form } from "react-bootstrap";
// import { Button, FormControl } from "@mui/material";
// import Button from "@material-ui/core/Button";
// import { TextField } from "material-ui";

function SignUpForm(props) {
console.log(this.setEmail)

  return (
<>
          <TextField 
          required
          variant="outlined"
          // id="outline-required"
          label="First Name"
          name='first_name'
          onChange={e=>this.setFirstName({name:e.target.name, value: e.target.value})}
        ></TextField>

              <TextField 
          required
          variant="outlined"
          // id="outline-required"
          label="Last Name"
          name='last_name'
          onChange={e=>this.setLastName({name:e.target.name, value: e.target.value})}
        ></TextField>

              <TextField 
          required
          variant="outlined"
          // id="outline-required"
          label="UserName"
          name='username'
          onChange={e=>this.setUsername({name:e.target.name, value: e.target.value})}
        ></TextField>

              <TextField 
          required
          variant="outlined"
          // id="outline-required"
          label="Email"
          name='email'
          onChange={e=>this.setEmail({name:e.target.name, value: e.target.value})}
        ></TextField>
              <TextField 
          required
          variant="outlined"
          // id="outline-required"
          label="Password"
          name="password"
          type="password"
          onChange={e=>this.setPassword({name:e.target.name, value: e.target.value})}
        ></TextField>

        <TextField 
          required
          variant="outlined"
          // id="outline-required"
          label="Password Confirmation"
          name="password_confirmation"
          type="password"
          onChange={e=>this.setPasswordConfirmation({name:e.target.name, value: e.target.value})}
        ></TextField>


        </>
  );
}
export default SignUpForm;
